import {useState, useEffect} from 'react';
import pp from './Assets/linkedin_profile.png';

const ProfileText = ({onChange}) => {
  const [enter, setEnter] = useState(0);
  let profileTextDiv = "";
  let profileText = "";
  let profileTwoDiv = "";
  let profileTextTwo = "";

  useEffect(() => {
    onChange(setEnter);
    if (enter === 1) {
      profileTextDiv = "Profile-text-div";
      profileText = "Profile-text";
      profileTwoDiv = "Profile-two-div";
      profileTextTwo = "Profile-text-two";
    }
  }, [])

  return (
    <div className='Outer-profile'>
      <div className='Profile-text-div'>
        <h1 className='Profile-text'>{`BRANDON\nYANG`}</h1>
      </div>
      <div className='Profile-two-div'>
        <h1 className='Profile-text-two'>{"Software Developer\nFull-time student\nGeorgia Institute of Technology"}</h1>
      </div>
    </div>
  )
}

export default ProfileText;
